import React from "react";

import Form from "./Form.jsx";
import s from "./ContactPage.module.sass";

const ContactPage = () => {
  return (
    <div className={s.ContactPage}>
      <h1>Форма контакта</h1>
      <Form />
    </div>
  );
};

export default ContactPage;
